  return (
    <div id="infomatic">
      <p>
        Born in New Jersey. Grew up in Pennsylvania. Went to college in Indiana.
        Spent time in Tennessee and now living in Vermont. I've been around a
        fair chunk of the US; gotten to learn about many different subcultures
        and met all sorts of interesting and diverse people. I{" "}
      </p>
    </div>
  );
};

export default AboutMe;
